package hu.bible;

public class hubible33 {

public hubible33() {

putmapbible33();

}

private void putmapbible33() {

husuperobject.biblemap.put("b33_1_1", new husuperobject(33,1,1,"Az Úr igéje, a mely lõn a moreseti Mikeáshoz, Jótám, Akház és Ezékiásnak, Júda királyainak idejében, a melyet látott Samária és Jeruzsálem felõl."));
husuperobject.biblemap.put("b33_1_2", new husuperobject(33,1,2,"Halljátok meg minden népek, figyelmezz föld és annak teljessége. És az Úr Isten legyen bizonyság ellenetek; az Úr az õ szent templomából!"));
husuperobject.biblemap.put("b33_1_3", new husuperobject(33,1,3,"Mert ímé, kijõ az Úr az õ helyérõl, és leszáll és lépdel a földnek magaslatain."));
husuperobject.biblemap.put("b33_1_4", new husuperobject(33,1,4,"És szétmállanak alatta a hegyek, a völgyek pedig szétszakadoznak, mint a viasz a tûz elõtt, mint a meredekrõl leszakadó vizek."));
husuperobject.biblemap.put("b33_1_5", new husuperobject(33,1,5,"A Jákób vétkéért lészen mindez, és az Izráel házának bûnei miatt! Micsoda a Jákób vétke? Avagy nem Samária-é? És mik a Júda magaslatai? Avagy nem Jeruzsálem-é?"));
husuperobject.biblemap.put("b33_1_6", new husuperobject(33,1,6,"De olyanná teszem Samáriát, mint a mezõben való kõrakás, szõlõ-plánták [helyévé;] és lezúdítom a völgybe az õ köveit, és még fundamentomit is kimutatom."));
husuperobject.biblemap.put("b33_1_7", new husuperobject(33,1,7,"Faragott képei mind összetöretnek és minden ajándékát tûz égeti meg. Minden bálványait semmivé teszem; mert paráznaság bérébõl gyûjtögette azokat, azért ismét paráznaság bérévé legyenek."));
husuperobject.biblemap.put("b33_1_8", new husuperobject(33,1,8,"E miatt kesergek és jajgatok; ruhátalan és mezítelen járok. Üvöltök, mint a sakálok, és sikongok, mint a struczmadarak."));
husuperobject.biblemap.put("b33_1_9", new husuperobject(33,1,9,"Mert halálosak az õ sebei. Bizony Júdáig ér; népem kapujáig hatol, Jeruzsálemig."));
husuperobject.biblemap.put("b33_1_10", new husuperobject(33,1,10,"Gáthban hírül ne adjátok; sírván ne sírjatok; Beth-le- Afrában porba heveredtem."));
husuperobject.biblemap.put("b33_1_11", new husuperobject(33,1,11,"Költözzetek el, Safirnak lakója gyalázatos meztelenül! Nem vonult ki Saanán lakosa; Beth-Eselnek siralma nem enged tartózkodni."));
husuperobject.biblemap.put("b33_1_12", new husuperobject(33,1,12,"Mert beteg lett Marótnak lakosa [az õ] java[i] miatt; mert veszedelem szállt le az Úrtól Jeruzsálemnek kapujára."));
husuperobject.biblemap.put("b33_1_13", new husuperobject(33,1,13,"Gyors paripához kösd a szekeret, Lákisnak lakója! [ki] a bûnnek kezdõje valál a Sion leányánál. Bizony te benned találtatnak Izráel vétkei!"));
husuperobject.biblemap.put("b33_1_14", new husuperobject(33,1,14,"Azért adj válólevelet Moreset-Gátnak! Akzib házai megcsalják Izráel királyait."));
husuperobject.biblemap.put("b33_1_15", new husuperobject(33,1,15,"Még hozok én te néked örököst, Marésa lakosa; Adullámig hat el Izráel dicsõsége!"));
husuperobject.biblemap.put("b33_1_16", new husuperobject(33,1,16,"Nyírd le, kopaszítsd meg magadat a te gyönyörûséges fiaidért! Szélesítsd meg kopaszságodat, mint a keselyû; mert rabságra vitettek el tõled!"));
husuperobject.biblemap.put("b33_2_1", new husuperobject(33,2,1,"Jaj azoknak, a kik hamisságot gondolnak és a kik ágyasházukban gonoszságot cselekesznek, [és] végrehajtják azt, mihelyt megvirrad, mert hatalmuk van hozzá."));
husuperobject.biblemap.put("b33_2_2", new husuperobject(33,2,2,"Megkívánják a mezõket és elrabolják, és a házakat és elszedik; és nyomorgatják a gazdát, és az õ házanépét az embert és az õ örökségét!"));
husuperobject.biblemap.put("b33_2_3", new husuperobject(33,2,3,"Annakokáért ezt mondja az Úr: Ímé, én [is] gonoszt gondolok e nemzetség ellen, melybõl ki nem vonhatjátok a ti nyakatokat és nem jártok kevélyen, mivel gonosz idõ lészen az!"));
husuperobject.biblemap.put("b33_2_4", new husuperobject(33,2,4,"Azon a napon példabeszéd támad rólatok, és siralmat sírnak, mondván: Oda van! elpusztultunk! Népem örökségét felcserélte! Miként rabolja el tõlem; hûtelennek osztja ki mezeinket!"));
husuperobject.biblemap.put("b33_2_5", new husuperobject(33,2,5,"Azért nem lesz néked, a ki mérõzsinórt vessen sors szerint az Úrnak gyülekezetében."));
husuperobject.biblemap.put("b33_2_6", new husuperobject(33,2,6,"Ne prófétáljatok! prófétálnak õk. [Ha ]nem prófétálnak ezeknek, nem múlik el a gyalázat!"));
husuperobject.biblemap.put("b33_2_7", new husuperobject(33,2,7,"Oh te, ki Jákób házának mondatol! hát türelmetlen-é az Úrnak lelke, avagy ezek-é az õ cselekedetei? Nem javára válnak-é az én cselekedeteim annak, a ki igazán jár?"));
husuperobject.biblemap.put("b33_2_8", new husuperobject(33,2,8,"A minap mint egy ellenség támadt fel az én népem; a köntösrõl a palástot letépik a gyanútlanul járókról, a háborútól idegenkedõkrõl."));
husuperobject.biblemap.put("b33_2_9", new husuperobject(33,2,9,"Népem asszonyait kiûzitek boldogságuk házából; kisdedeiktõl örökre elveszitek az én dicsõségemet."));
husuperobject.biblemap.put("b33_2_10", new husuperobject(33,2,10,"Keljetek fel és menjetek ki, mert ez nem a nyugalomnak helye; a tisztátalanság miatt, a mely elveszít, és pedig borzasztó veszedelemmel!"));
husuperobject.biblemap.put("b33_2_11", new husuperobject(33,2,11,"Ha valamely szélházi és csalárd így hazudoznék: Prédikálok néked borról és részegítõ italról, az volna e népnek prófétája."));
husuperobject.biblemap.put("b33_2_12", new husuperobject(33,2,12,"Mindenestõl egybegyûjtelek téged, Jákób! Összetakarítom Izráel maradékát. Összegyûjtöm õket, mint a boczrai juhokat, mint a nyájat az õ karámja közé; hemzsegnek majd az ember-sokaság miatt."));
husuperobject.biblemap.put("b33_2_13", new husuperobject(33,2,13,"Elõttök megy fel az [út]törõ; kitörnek és átmennek a kapun és kivonulnak, és elõttök megy a királyuk, és élükön az Úr!"));
husuperobject.biblemap.put("b33_3_1", new husuperobject(33,3,1,"És mondám én: Halljátok, kérlek, Jákób fejedelmei és Izráel házának vezérei: Nem a ti tisztetek-é tudni az ítéletet?!"));
husuperobject.biblemap.put("b33_3_2", new husuperobject(33,3,2,"Ti, kik gyûlölitek a jót és kedvelitek a gonoszt! A kik levonszátok róluk bõrüket és csontjaikról az õ húsokat!"));
husuperobject.biblemap.put("b33_3_3", new husuperobject(33,3,3,"A kik megeszik az én népemnek húsát, és lenyúzzák róluk bõrüket, és összetörik csontjaikat, és feldarabolják, akár csak a fazékba, és mint húst a tálba."));
husuperobject.biblemap.put("b33_3_4", new husuperobject(33,3,4,"Kiáltanak majd az Úrhoz, de nem hallgatja meg õket; sõt elrejti akkor orczáját elõlök, mivelhogy gonoszokká lettek cselekedeteik."));
husuperobject.biblemap.put("b33_3_5", new husuperobject(33,3,5,"Így szól az Úr a próféták ellen, a kik elámítják az én népemet, a kik, ha van mit rágniok, békességet hirdetnek, az ellen pedig, a ki nem vet valamit szájokba, hadat indítanak."));
husuperobject.biblemap.put("b33_3_6", new husuperobject(33,3,6,"Azért éjszaka [száll] rátok, hogy ne lássatok, és sötétség [jõ] rátok, hogy ne jövendölhessetek, és a nap lemegy a próféták felett, és elsötétül rajtok a nappal."));
husuperobject.biblemap.put("b33_3_7", new husuperobject(33,3,7,"És megszégyenülnek a látók, és elpirulnak a jövendõmondók, és elfedik szájokat mindnyájan, mert nem lészen felelet Istentõl."));
husuperobject.biblemap.put("b33_3_8", new husuperobject(33,3,8,"Én ellenben megteljesedem az Úr lelkének erejével, és ítélettel és hatalommal, hogy hirdessem Jákóbnak az õ vétkét, és Izráelnek az õ bûnét."));
husuperobject.biblemap.put("b33_3_9", new husuperobject(33,3,9,"Halljátok ezt, kérlek, Jákób házának fejei és Izráel házának vezérei! a kik útáljátok az ítéletet, és minden igazságot elcsavartok;"));
husuperobject.biblemap.put("b33_3_10", new husuperobject(33,3,10,"A kik vérrel építitek a Siont, és Jeruzsálemet hamissággal!"));
husuperobject.biblemap.put("b33_3_11", new husuperobject(33,3,11,"[Kiknek] fejedelmei ajándékért ítélnek, és papjaik jutalomért tanítanak, és prófétáik pénzért jövendölnek, és mégis az Úrra támaszkodnak, mondván: Avagy nincsen-é közöttünk az Úr?! Nem következik mi reánk veszedelem!"));
husuperobject.biblemap.put("b33_3_12", new husuperobject(33,3,12,"Azért ti miattatok mezõvé szántatik a Sion, és kõhalommá lesz Jeruzsálem, a templom hegye pedig erdõs hegygyé."));
husuperobject.biblemap.put("b33_4_1", new husuperobject(33,4,1,"És lészen: az utolsó idõben az Úr házának hegye a hegyek fölé helyeztetik, és felülemelkedik az a halmokon, és népek özönlenek reá."));
husuperobject.biblemap.put("b33_4_2", new husuperobject(33,4,2,"Pogányok is sokan mennek, és mondják: Jertek, menjünk fel az Úr hegyére és a Jákób Istenének házához, hogy megtanítson minket az õ útaira, és járjunk az õ ösvényein! Mert Sionból jõ ki a törvény, és az Úr beszéde Jeruzsálembõl."));
husuperobject.biblemap.put("b33_4_3", new husuperobject(33,4,3,"És sok népek között ítéletet tészen, és megfedd erõs nemzeteket nagy messze [földig] és fegyvereiket kapákká kovácsolják, dárdáikat pedig sarlókká; nép népre fegyvert nem emel, és hadakozást többé nem tanulnak."));
husuperobject.biblemap.put("b33_4_4", new husuperobject(33,4,4,"És kiki nyugszik az õ szõlõje alatt és fügefája alatt, és senki meg nem rettenti õket, mert a Seregek Urának szája szólott."));
husuperobject.biblemap.put("b33_4_5", new husuperobject(33,4,5,"Mert minden nép a maga istenének nevében jár, és mi is a mi Urunk Istenünk nevében járunk örökkön örökké."));
husuperobject.biblemap.put("b33_4_6", new husuperobject(33,4,6,"Azon a napon, azt mondja az Úr, összegyûjtöm a sántát, és összeszedem az elszéledetteket, és a kiket megsanyargattam."));
husuperobject.biblemap.put("b33_4_7", new husuperobject(33,4,7,"És a sántát maradékká teszem, az elszélesztettet pedig erõs nemzetté, és az Úr uralkodik rajtok a Sion hegyén mostantól fogva mindörökké."));
husuperobject.biblemap.put("b33_4_8", new husuperobject(33,4,8,"És te nyájnak tornya, Sion leányának vára! Eljõ tehozzád és elérkezik az elõbbi hatalom, a Jeruzsálem leányának birodalma."));
husuperobject.biblemap.put("b33_4_9", new husuperobject(33,4,9,"Miért kiáltasz hát kiáltva? Nincsen-é közötted király? Elveszett-é a te tanácsadód, hogy úgy elfogott a fájdalom, mint a gyermek-szûlõt?!"));
husuperobject.biblemap.put("b33_4_10", new husuperobject(33,4,10,"Gyötrõdj és kinlódj, Sionnak leánya, mint a gyermek-szülõ! Mert ímé, kimégy a városból, és a mezõn tanyázol, és egészen Bábelig mégysz. Ott szabadíttatol meg; ott vált ki téged az Úr, ellenségednek kezébõl."));
husuperobject.biblemap.put("b33_4_11", new husuperobject(33,4,11,"Mert ímé, sok nemzetség gyûlt össze ellened, a kik ezt mondják: Legyen szentségtelen, és legeltessük szemeinket a Sionon!"));
husuperobject.biblemap.put("b33_4_12", new husuperobject(33,4,12,"De õk nem tudják az Úr gondolatait és nem értik az õ szándékát, hogy összegyûjti õket, mint a kévét a szérûre."));
husuperobject.biblemap.put("b33_4_13", new husuperobject(33,4,13,"Kelj fel és csépelj, Sionnak leánya! Mert vassá teszem a te szarvaidat, körmeidet pedig aczéllá teszem, és széttiporsz sok népeket, és rablott kincseiket az Úrnak áldozom, javaikat pedig az egész föld Urának."));
husuperobject.biblemap.put("b33_5_1", new husuperobject(33,5,1,"Seregelj hát egybe, seregek leánya! Ostrommal támadt ellenünk; pálczával verjék arczul Izráel biráját!"));
husuperobject.biblemap.put("b33_5_2", new husuperobject(33,5,2,"De te, Efratának Bethleheme, bár kicsiny vagy a Júda ezrei között: belõled származik nékem, a ki uralkodó az Izráelen; a kinek származása eleitõl fogva, öröktõl fogva van."));
husuperobject.biblemap.put("b33_5_3", new husuperobject(33,5,3,"Azért odaadja õket, míg a szûlõ szûl, de az õ atyjafiainak maradékai visszatérnek Izráel fiaihoz."));
husuperobject.biblemap.put("b33_5_4", new husuperobject(33,5,4,"És megáll, és legeltet az Úrnak erejével, az Úrnak az õ Istenének fenséges nevével, és [bátorsággal] lakoznak, mert ímé felmagasztaltatik a földnek határáig."));
husuperobject.biblemap.put("b33_5_5", new husuperobject(33,5,5,"És õ a [mi] békesség[ünk]. Ha az Assirus eljõ a mi földünkre és megtapodja palotáinkat: állatunk ellene hét pásztort és nyolcz fejedelmi férfiút."));
husuperobject.biblemap.put("b33_5_6", new husuperobject(33,5,6,"És megrontják Assiria földjét fegyverrel Nimród földjét is az õ kapuiban; és megszabadít az Assirustól, ha a mi földünkre eljõ és a mi határunkba lép."));
husuperobject.biblemap.put("b33_5_7", new husuperobject(33,5,7,"És a Jákóbnak maradéka olyan lészen a sok nép között, mint az Úrtól való harmat, mint a zápor a fûnek, mely nem emberben reménykedik, és nem bízik embernek fiaiban."));
husuperobject.biblemap.put("b33_5_8", new husuperobject(33,5,8,"És a Jákób maradéka a pogányok között, a sok nép között olyan lészen, mint az oroszlán az erdei vadak között; mint az oroszlán-kölyök a juhoknak nyája között, a mely ha betör, tipor és tép, és nincs, a ki [tõle] megszabadítson."));
husuperobject.biblemap.put("b33_5_9", new husuperobject(33,5,9,"Erõt vészen a te kezed szorongatóidon, és minden ellenségeid kivágattatnak."));
husuperobject.biblemap.put("b33_5_10", new husuperobject(33,5,10,"És lészen azon a napon, azt mondja az Úr, kivágom lovaidat közüled, és elvesztem hadi-szekereidet."));
husuperobject.biblemap.put("b33_5_11", new husuperobject(33,5,11,"És kivágom földednek városait, és ledöntöm minden erõsségeidet."));
husuperobject.biblemap.put("b33_5_12", new husuperobject(33,5,12,"És kivágom kezedbõl a bûvszereket, és szemfényvesztõid nem lesznek néked."));
husuperobject.biblemap.put("b33_5_13", new husuperobject(33,5,13,"És kivágom faragott képeidet és bálványaidat közüled, és nem imádod többé kezeidnek csinálmányait."));
husuperobject.biblemap.put("b33_5_14", new husuperobject(33,5,14,"És kiszaggatom a te berkeidet közüled és elpusztítom a te városaidat."));
husuperobject.biblemap.put("b33_5_15", new husuperobject(33,5,15,"És haraggal és hévvel állok bosszút a pogányokon, a kik nem engedelmeskedtek."));
husuperobject.biblemap.put("b33_6_1", new husuperobject(33,6,1,"Halljátok csak, a mit mond az Úr! Kelj fel, perelj a hegyekkel, és hallják meg szódat a halmok."));
husuperobject.biblemap.put("b33_6_2", new husuperobject(33,6,2,"Halljátok meg hegyek az Úr peres dolgát, és ti, a földnek örök alapjai! Mert pere van az Úrnak az õ népével, és az Izráellel is perbe száll."));
husuperobject.biblemap.put("b33_6_3", new husuperobject(33,6,3,"Én népem! mit vétettem te ellened, és mivel fárasztottalak el téged?! Tégy vallást ellenem!"));
husuperobject.biblemap.put("b33_6_4", new husuperobject(33,6,4,"Hiszen felhoztalak Égyiptom földjérõl, és a szolgák házából megváltottalak, és elõtted küldém Mózest, Áront és Máriát!"));
husuperobject.biblemap.put("b33_6_5", new husuperobject(33,6,5,"Én népem! Emlékezzél csak: mit koholt Bálák, Moábnak királya, és mit felelt néki Bálám, a Beor fia? Sittimtõl fogva Gilgálig, hogy megismerjed az Úr igazságos cselekedeteit."));
husuperobject.biblemap.put("b33_6_6", new husuperobject(33,6,6,"Mivel menjek eleibe az Úrnak? Hajlongjak-é a magasságos Istennek? Égõáldozatokkal menjek-é elébe, esztendõs borjúkkal?!"));
husuperobject.biblemap.put("b33_6_7", new husuperobject(33,6,7,"Kedvét leli-é az Úr ezernyi kosokban, [vagy] tízezernyi olaj-patakokban? Elsõszülöttemet adjam-é vétkemért, [vagy] méhem gyümölcsét lelkemnek bûnéért?!"));
husuperobject.biblemap.put("b33_6_8", new husuperobject(33,6,8,"Megjelentette néked, oh ember, mi légyen a jó, és mit kiván az Úr te tõled! Csak azt, hogy igazságot cselekedjél, szeressed az irgalmasságot, és hogy alázatosan járj a te Isteneddel."));
husuperobject.biblemap.put("b33_6_9", new husuperobject(33,6,9,"Az Úrnak szava kiált a városnak, és a te neved néz bölcseségre. Halljátok meg a vesszõt és ki rendeli azt?!"));
husuperobject.biblemap.put("b33_6_10", new husuperobject(33,6,10,"[Vannak-é] még a gonosznak házában hamissággal gyûjtött kincsek, és ösztövér véka, a mely útálatos?"));
husuperobject.biblemap.put("b33_6_11", new husuperobject(33,6,11,"Vajjon jóváhagyom-é a hamis mértéket, és a zsákba [rejtett] csalárd fontokat?"));
husuperobject.biblemap.put("b33_6_12", new husuperobject(33,6,12,"Mert a gazdagok megtöltöztek köztök ragadománynyal, lakosai pedig hazugságot szólnak, és nyelvök csalárd az õ szájokban."));
husuperobject.biblemap.put("b33_6_13", new husuperobject(33,6,13,"Én is azért megvervén, beteggé teszlek téged; elpusztítalak a te bûneid miatt."));
husuperobject.biblemap.put("b33_6_14", new husuperobject(33,6,14,"Eszel te, de meg nem elégszel, és benned [marad] a te éhséged; és gyûjtesz, de nem takarítasz, és a mit megtakarítsz is, fegyverre hányom."));
husuperobject.biblemap.put("b33_6_15", new husuperobject(33,6,15,"Vetsz te, de nem aratsz; olajat sajtolsz te, de nem kened [magadat] olajjal, és mustot is, de bort nem iszol!"));
husuperobject.biblemap.put("b33_6_16", new husuperobject(33,6,16,"Mert az Omri parancsolataihoz szabjátok magatokat és az Ákháb házának minden dolgához, és azoknak tanácsán jártok! Hogy pusztasággá tegyelek tégedet, az õ lakosait pedig csúfsággá, és hordozzátok népemnek gyalázatát."));
husuperobject.biblemap.put("b33_7_1", new husuperobject(33,7,1,"Jaj nékem, mert olyanná lettem, mint a letakarított mezõ, mint a megszedett szõlõ: egy enni való gerezd sem maradott; [pedig] zsengére vágyott a lelkem!"));
husuperobject.biblemap.put("b33_7_2", new husuperobject(33,7,2,"Elveszett e földrõl a kegyes, és igaz sincs az emberek között. Mindnyájan vér után ólálkodnak, kiki hálóval vadássza atyjafiát."));
husuperobject.biblemap.put("b33_7_3", new husuperobject(33,7,3,"Gonoszságra [készek] a kezek, hogy jól vigyék véghez; a fejedelem követelõzik, és a biró fizetésre [vár;] a fõember is maga mondja el lelke kívánságát, és összeszövik azt."));
husuperobject.biblemap.put("b33_7_4", new husuperobject(33,7,4,"A ki jó közöttök, olyan mint a tüske, az igaz olyan, mint a tövisbokor. A te õrállóidnak napja, a te megítélésed eljött; most következik el az õ zûrzavaruk."));
husuperobject.biblemap.put("b33_7_5", new husuperobject(33,7,5,"Ne higyjetek a barátnak; ne bízzatok a tanácsadóban; az öledben ülõ elõtt [is] zárd be szádnak ajtaját."));
husuperobject.biblemap.put("b33_7_6", new husuperobject(33,7,6,"Mert a fiú bolondnak tartja atyját, a leány anyja ellen támad, a meny az õ napára; az embernek saját háznépe az ellensége."));
husuperobject.biblemap.put("b33_7_7", new husuperobject(33,7,7,"De én az Úrra nézek, várom az én szabadításom Istenét; meghallgat engem az én Istenem!"));
husuperobject.biblemap.put("b33_7_8", new husuperobject(33,7,8,"Ne örülj, én ellenségem! Elestem ugyan, de felkelek, mert ha még a setétségben ülnék [is,] az Úr az én világosságom!"));
husuperobject.biblemap.put("b33_7_9", new husuperobject(33,7,9,"Az Úr haragját hordozom, mert vétkeztem ellene; mindaddig, a míg leperli peremet és meghozza ítéletemet. Kivisz engem a világosságra, meglátom az õ igazságát."));
husuperobject.biblemap.put("b33_7_10", new husuperobject(33,7,10,"De meglátja ellenségem is és szégyen borítja el, a ki ezt mondja nékem: Hol az Úr, a te Istened? Meglátják õt az én szemeim, hogy ímé széttapostatik, mint az utcza-sár."));
husuperobject.biblemap.put("b33_7_11", new husuperobject(33,7,11,"Falaid megépítésének napja! e napon távol lesz a törvény!"));
husuperobject.biblemap.put("b33_7_12", new husuperobject(33,7,12,"Azon a na[pon] eljõnek hozzád Assiriából és Égyiptom városaiból; Égyiptomtól a folyamig, tengertõl tengerig és hegytõl hegyig."));
husuperobject.biblemap.put("b33_7_13", new husuperobject(33,7,13,"És pusztává lesz a föld az õ lakói miatt, az õ cselekedeteik gyümölcséért."));
husuperobject.biblemap.put("b33_7_14", new husuperobject(33,7,14,"Legeltesd népedet a te vesszõddel, a te örökségednek nyáját, a mely magánosan lakozik az erdõben, a Kármel közepén. Legeljenek Básánban és Gileádban, mint a hajdankor napjain!"));
husuperobject.biblemap.put("b33_7_15", new husuperobject(33,7,15,"Mint az Égyiptom földérõl kijövetelednek idején, láttatok vele csodadolgokat."));
husuperobject.biblemap.put("b33_7_16", new husuperobject(33,7,16,"Látják [ezt] a pogányok és megszégyenülnek minden erejökkel. Kezöket szájokra teszik, füleik megsiketülnek;"));
husuperobject.biblemap.put("b33_7_17", new husuperobject(33,7,17,"Nyalják a port, mint a kígyó, mint a föld férgei; reszketve jõnek rejtekeikbõl; remegve folyamodnak az Úrhoz, a mi Istenünkhöz, és félnek tetõled!"));
husuperobject.biblemap.put("b33_7_18", new husuperobject(33,7,18,"Kicsoda olyan Isten, mint te, a ki megbocsátja a bûnt és elengedi öröksége maradékának vétkét?! Nem tartja meg haragját örökké, mert gyönyörködik az irgalmasságban!"));
husuperobject.biblemap.put("b33_7_19", new husuperobject(33,7,19,"Hozzánk térvén, könyörül rajtunk; eltapodja álnokságainkat. Bizony a tenger mélységébe veted minden bûnünket!"));
husuperobject.biblemap.put("b33_7_20", new husuperobject(33,7,20,"Hûséget mutatsz a Jákóbnak, irgalmasságot Ábrahámnak, a mint megesküdtél atyáinknak még az õsidõkben."));

}

}